import React from 'react';

import Select from 'react-select';

export default class Filters extends React.Component {
    constructor(props) {
        super(props);

        this.callback = props.callback;
        this.data     = props.data;

        this.state = {
            filters: props.filters
        };
    }

    render() {
        return (
            <>
                <div className="cs-filters-wrapper">

                    <label htmlFor="instructors">Instructors: </label>
                    <input list="instructors" name="instructors" id="instructors" />
                    <datalist id="instructors">
                        {Object.keys(this.data.instructors).map((value, index) => {
                            return <option key={value} value={value} />;
                        })}
                    </datalist>


                    <button onClick={() => this.callback(this.state.filters)}>Apply</button>
                </div>
            </>
        );
    }
}
